 p_id=>wwv_flow_api.id(9992146151279909245)
,p_plugin_type=>'ITEM TYPE'
,p_name=>'DE.BLOGSPOT.NHASKO.SPINNER'
,p_display_name=>'Item Spinner'
,p_supported_ui_types=>'DESKTOP'
,p_supported_component_types=>'APEX_APPLICATION_PAGE_ITEMS:APEX_APPL_PAGE_IG_COLUMNS'
,p_image_prefix => nvl(wwv_flow_application_install.get_static_plugin_file_prefix('ITEM TYPE','DE.BLOGSPOT.NHASKO.SPINNER'),'')
,p_plsql_code=>wwv_flow_string.join(wwv_flow_t_varchar2(
'procedure item_spinner (',
'    p_item   in            apex_plugin.t_item,',
'    p_plugin in            apex_plugin.t_plugin,',
'    p_param  in            apex_plugin.t_item_render_param,',
'    p_result in out nocopy apex_plugin.t_item_render_result )',
'is',
'  -- internal plugin variables',
'  c_plugin_type          constant varchar2(255)   := ''ITEM_SPINNER'';',
'  c_element_id           constant varchar2(255)   := p_item.name;',
'  l_item_name            varchar2(30);',
'  l_init_code            varchar2(32767);',
'  l_html_string          varchar2(2000);',
'  --',
'  -- custom plugin attributes',
'  v_type apex_application_page_items.attribute_01%type := nvl(p_item.attribute_01,''standard'');',
'  v_min apex_application_page_items.attribute_02%type := nvl(to_number(p_item.attribute_02),-9999999999999999999999999999999);',
'  v_max apex_application_page_items.attribute_03%type := nvl(to_number(p_item.attribute_03),9999999999999999999999999999999);',
'  v_step apex_application_page_items.attribute_04%type := nvl(p_item.attribute_04,1);',
'  v_decimal_places apex_application_page_items.attribute_05%type := nvl(p_item.attribute_05,2);',
'  v_language apex_application_page_items.attribute_06%type := COALESCE(p_item.attribute_06,p_item.attribute_08,''de-DE'');',
'  v_currency apex_application_page_items.attribute_07%type := nvl(p_item.attribute_07,''de-DE'');',
'  --',
'  v_value        varchar2(4000) := apex_escape.html(to_char(p_param.value));',
'  ',
'begin',
'  -- printer friendly display',
'  if p_param.is_printer_friendly then',
'    apex_plugin_util.print_display_only(',
'      p_item_name        => p_item.name,',
'      p_display_value    => p_param.value,',
'      p_show_line_breaks => false,',
'      p_escape           => true,',
'      p_attributes       => p_item.element_attributes',
'    );',
'',
'  -- read only display',
'  elsif p_param.is_readonly then',
'     apex_plugin_util.print_display_only(',
'      p_item_name        => p_item.name,',
'      p_display_value    => p_param.value,',
'      p_show_line_breaks => false,',
'      p_escape           => true,',
'      p_attributes       => p_item.element_attributes',
'    );',
'',
'  -- normal display',
'  else',
'    l_item_name     := apex_plugin.get_input_name_for_page_item(false);',
'    -- build input html string',
'    l_html_string := ''<input type="text" '';',
'    l_html_string := l_html_string || ''name="'' || l_item_name || ''" '';',
'    l_html_string := l_html_string || ''id="'' || c_element_id || ''" '';',
'    l_html_string := l_html_string || ''value="'' || v_value || ''" '';',
'    l_html_string := l_html_string || ''class="text_field apex-item-text"''||case when p_param.is_readonly then ''disabled="disabled"'' else '''' end || ',
'    coalesce(p_item.element_attributes, '''') || '' />'';',
'    --',
'    sys.htp.prn(l_html_string);',
'    --',
'  end if;',
'  ',
'    apex_css.add_file (',
'          p_name      => ''jquery-ui'',',
'          p_directory => p_plugin.file_prefix );',
'    apex_css.add_file (',
'          p_name      => ''ItemSpinner'',',
'          p_directory => p_plugin.file_prefix );',
'    apex_javascript.add_library(',
'          p_name => ''ItemSpinner'',',
'          p_directory => p_plugin.file_prefix,',
'          p_version => null);',
'    apex_javascript.add_library(',
'          p_name => ''jquery-ui'',',
'          p_directory => p_plugin.file_prefix,',
'          p_version => null);',
'    apex_javascript.add_library(',
'          p_name => ''jquery.mousewheel'',',
'          p_directory => p_plugin.file_prefix,',
'          p_version => null);',
'    apex_javascript.add_library(',
'          p_name => ''globalize'',',
'          p_directory => p_plugin.file_prefix,',
'          p_version => null);',
'    apex_javascript.add_library(',
'          p_name => ''globalize.culture.de-DE'',',
'          p_directory => p_plugin.file_prefix,',
'          p_version => null);',
'     apex_javascript.add_library(',
'          p_name => ''globalize.culture.de-CH'',',
'          p_directory => p_plugin.file_prefix,',
'          p_version => null);',
'     apex_javascript.add_library(',
'          p_name => ''globalize.culture.ja-JP'',',
'          p_directory => p_plugin.file_prefix,',
'          p_version => null);',
'     apex_javascript.add_library(',
'          p_name => ''globalize.culture.es-MX'',',
'          p_directory => p_plugin.file_prefix,',
'          p_version => null);',
'     apex_javascript.add_library(',
'          p_name => ''globalize.culture.ru-RU'',',
'          p_directory => p_plugin.file_prefix,',
'          p_version => null);',
'     apex_javascript.add_library(',
'          p_name => ''globalize.culture.en-GB'',',
'          p_directory => p_plugin.file_prefix,',
'          p_version => null);',
'     apex_javascript.add_library(',
'          p_name => ''globalize.culture.tr-TR'',',
'          p_directory => p_plugin.file_prefix,',
'          p_version => null);',
'     apex_javascript.add_library(',
